import axios from "axios";
import { FaHeart } from "react-icons/fa";
import HamburgerMenu from "../components/HamburgerMenu";
import { UserInfo } from "../components/UserInfo";
import { useEffect, useReducer, useState } from "react";
import Grid from "../components/Grid";
import "./Mypage.css"
import { useGetUserInfo } from "../hooks/useGetUserInfo"
export const MyPage = () => {
    const API_BASE_URL = process.env.REACT_APP_GO_BASE_URL;
    // letだとレンダリングされずuseEffectで登録できない
    const [photos, setPhotos] = useState([]);
    const username = useGetUserInfo();
    const selectLikedPhotos = async () => {
        try {
            const response = await axios.get(`${API_BASE_URL}/selectLikedPhoto`, {
                params: {
                    username: username
                }
            });
            setPhotos(response.data.photo);
        } catch (error) {
            console.error("CannotSelectLikedPhoto", error)
        }
    }
    useEffect(() => {
        if (username) {
            selectLikedPhotos();
        }
    }, [username]);
    return (
        <div className="app-container">
            <div className="sidebar">
                <HamburgerMenu menu1="MyPage" menu2="Logout" />
            </div>
            <div className="userInfoContainer">
                <UserInfo username={username} />
            </div>
            <div className="mypageText">
                いいね済みの写真
            </div>
            <div className="content">
                {photos && <Grid photos={photos} username={username} />}
            </div>
        </div>

    );
}
